import React from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  Grid,
  CardMedia,
  Card,
  CardContent,
  CardActions,
} from "@material-ui/core";
import { makeStyles, ThemeProvider } from "@material-ui/styles";
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Box from '@material-ui/core/Box';
import PropTypes from 'prop-types';
import theme from "./theme"









const useStyles = makeStyles(theme => ({
  title: {
    margin: theme.spacing(1),
    color: theme.palette.primary.main
  },
  menunavbar: {
  color: theme.palette.primary.main,
  backgroundColor: theme.palette.secondary.main
  },
  card: {
  maxWidth: 400,
  color: theme.palette.secondary.main
  },
  media: {
    height: 450,
  },
  textbox: {
    color:theme.palette.primary.main,
    backgroundColor: theme.palette.secondary.main,
    height: 456,
    padding: '10px'
  }
}))




const MainPage = () => {

    const classes = useStyles();

    return (
    <Grid container direction = "column">
        <Grid item container>
            <Grid item xs={2} />
            <Grid item xs={3}>
                <Card className ={classes.card}>
                    <CardMedia 
                        className={classes.media}
                        image ={require("./Pictures/RobertEricSchultz3.jpg")}
                    />
                </Card>
            </Grid>

            <Grid item xs={5}>            

                <AppBar className ={classes.textbox} position = "static">
                    <Typography className ={classes.textbox}>
                         Hello my name is Robert Eric Schultz and
            I am a computer science student at The University of Texas at Arlington. I have a passion for computer science,
            specifically path planning, graphics, and game development. As someone in the Computer Scince field,
            I am morally obligated to tell you that I enjoy backpacking, hiking, and things that get me closer to nature.
                    </Typography>
                </AppBar>
            </Grid> 

            <Grid item xs={1}/>

        </Grid>
    </Grid>
    )
}

export default MainPage;
